import React from "react";
import './styles/Projects.css';
import racctracc from "./assets/images/loading-video.mp4";


const Projects = () => {
  const projects = [
    { 
      id: 1, 
      title: "RaccTracc", 
      imageUrl: "/path/to/racctracc.jpg" 
    },
    { 
      id: 2, 
      title: "3D Art", 
      imageUrl: "/path/to/3dart.jpg" 
    },
    { 
      id: 3, 
      title: "Medium 12pt", 
      imageUrl: "/path/to/medium12pt.jpg" 
    },
    { 
      id: 4, 
      title: "Apple Design", 
      imageUrl: "/path/to/appledesign.jpg" 
    },
    { 
      id: 5, 
      title: "Textures", 
      imageUrl: "/path/to/textures.jpg" 
    },
  ];

  return (
    <div className="projects-section bg-black text-white py-16 px-8">
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {projects.map((project) => (
          <div
            key={project.id}
            className="project-card relative rounded-lg overflow-hidden h-56 flex items-center justify-center transition-all duration-300 hover:scale-105"
            style={{
              backgroundImage: `url(${project.imageUrl})`,
              backgroundSize: 'cover',
              backgroundPosition: 'center',
            }}
          >
            {/* Thumbnail Title */}
            <span className="text-xl font-semibold text-white z-10">{project.title}</span>

            {/* Overlay with button */}
            <div className="absolute inset-0 bg-black bg-opacity-50 opacity-0 hover:opacity-100 transition-all duration-300 flex items-center justify-center z-20">
              <button className="px-6 py-2 border border-white text-white rounded-full hover:bg-white hover:text-black transition-all duration-300">
                View Details
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
